exports.step = function (input) {
	const methods = ["get", "post", "put", "delete"];
	let res = {
		status: 403,
		valid: false,
		message: "Forbidden",
		method: null,
	};
	if (input.trigger.headers.authorization !== "Bearer superSecretPassWordYellowJellyfish") {
		//reply default forbidden
	} else if (!methods.includes(input.trigger.method)) {
		(res.status = 405), (res.message = "Method not allowed");
	} else if (input.trigger.query.name === undefined || input.trigger.query.key === undefined) {
		(res.status = 400), (res.message = "Bad Request.  Include a name and key in query params.");
	} else if (input.trigger.method === "put") {
		try {
			if (input.trigger.body.data === undefined) {
				throw new error();
			}
			(res.status = 200), (res.message = "OK"), (res.valid = true), (res.method = input.trigger.method), (res.body = input.trigger.body.data), (res.query = input.trigger.query), (res.path = input.trigger.path);
		} catch (error) {
			(res.status = 400), (res.message = "Bad Request.  Include value to write in body.data");
		}
	} else {
		(res.status = 200), (res.message = "OK"), (res.valid = true), (res.method = input.trigger.method), (res.body = input.trigger.body), (res.query = input.trigger.query), (res.path = input.trigger.path);
	}
	return res;
};

